const Header = (props) => {
return(
  <div>
    <h1>{props.course}</h1>
  </div>
)
}

const Part_Number = (props) => {
return(
<div>
  <p>{props.part} {props.numberOfExercises}</p>
</div>
)
}

const Content = () => {
  const part1 = 'Fundamentals of React'
  const exercises1 = 10 
  const part2 = 'Using props to pass data'
  const exercises2 = 7
  const part3 = 'State of a component'
  const exercises3 = 14
  return(
    <div>
      <Part_Number part={part1}/>
    </div>
  )
}

const Total = (props) => {
  return(
    <div>
      <p> Number of Exercises {props.totalNumber}
      </p>
    </div>
  )
}

const App = () => {
  const course = 'Half Stack application development'


  return(
    <div>
      <Header course = {course}/>
      {/* <Content parts={part1} numberOfExercises={exercises1}/>
